def lists_with_product_equal_n(lst):
    n = len(lst)
    res = []
    for i in range(n):
        product = 1
        for j in range(i, i + n):
            product *= lst[j % n]
            if product == -76:
                res.append(lst[i: j + 1])
    return res
```
Note: The implementation assumes that the given circular list is not empty and contains only integers.
